  return (
    <SolutionLayout title="Сортировка массива">
      <div className={styles.container}>
        <div className={styles.navigation}>
        <div className={styles.navigation}>
          <RadioInput label="Выбор" extraClass={styles.navigationI}/>
          <RadioInput label="Пузырёк" />
